"MSG_CREDIT_EXPIRATION_WARNING" => "  ימים אחרונים. אשראי פאם פקס שלך הופך להיות ללא {inactivity} נראה כי לא שלחת פקס פעיל אם \nלא משתמשים בו במשך 180 ימים ברציפות.  יש לך עוד    ימים{days_to_expiration}   \nכיצד ניתן לשמור על מאזן פעיל? זה פשוט. בצע אחת מפעולות הבאות והמאזן \nיהיה פעיל עוד 180 ימים שלח מסמך או דף שער של פקס- {shop_url}  רכוש אשראי פאם-פקס או תוכנית מהחנות שלנו- אשראי פאם-פקס לא פעיל לא יופסד! תמיד ניתן להפעיל מחדש את אשראי פאם-פקס במועד מאוחר \nיותר. שום כסף לא מנוכה מן החשבון שלך ואיננו גובים תשלום עבור הפעלתו מחדש",
"MSG_CREDIT_EXPIRATION_WARNING_1" => "נראה כי לא נעשה שימוש כלשהו באשראי פאם-פקס שלך הרבה זמן. הוא הופך להיות ללא פעיל {days_to_expiration}  אם \nלא משתמשים בו במשך 180 ימים ברציפות.  יש לך\nימים לפני שהוא הופך להיות לא \nפעילכיצד ניתן לשמור על מאזן פעיל? זה פשוט. בצע אחת מפעולות הבאות והמאזן \nיהיה פעיל עוד 180 ימים שלח מסמך או דף שער פקס- {shop_url}  רכוש אשראי פאם-פקס או תוכנית מהחנות שלנו- אשראי פאם-פקס לא פעיל לא יופסד! תמיד ניתן להפעיל מחדש את אשראי פאם-פקס במועד מאוחר \nיותר. שום כסף לא מנוכה מן החשבון שלך ואיננו גובים תשלום עבור הפעלתו מחדש",
"MSG_CREDIT_EXPIRATION_WARNING_2" => "נראה כי לא נעשה שימוש כלשהו באשראי פאם-פקס שלך הרבה זמן. הוא הופך להיות ללא פעיל {days_to_expiration}  אם \nלא משתמשים בו במשך 180 ימים ברציפות.  יש לך\nימים לפני שהוא הופך להיות לא \nפעילכיצד ניתן לשמור על מאזן פעיל? זה פשוט. בצע אחת מפעולות הבאות והמאזן \nיהיה פעיל עוד 180 ימים שלח מסמך או דף שער פקס- {shop_url}  רכוש אשראי פאם-פקס או תוכנית מהחנות שלנו- אשראי פאם-פקס לא פעיל לא יופסד! תמיד ניתן להפעיל מחדש את אשראי פאם-פקס במועד מאוחר \nיותר. שום כסף לא מנוכה מן החשבון שלך ואיננו גובים תשלום עבור הפעלתו מחדש",
