"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_1" => "<div style=\"text-align: right;\">נראה כי לא נעשה שימוש כלשהו באשראי פאם-פקס שלך הרבה זמן. הוא הופך להיות ללא פעיל  {days_to_expiration}  אם \nלא משתמשים בו במשך 180 ימים ברציפות.  יש לך<br /></div>\n<div style=\"text-align: right;\">ימים לפני שהוא הופך להיות לא \nפעיל.\nכיצד ניתן לשמור על מאזן פעיל? זה פשוט. בצע אחת מפעולות הבאות והמאזן \nיהיה פעיל עוד 180 ימים<br /> שלח מסמך או דף שער פקס- <br />{shop_url}  רכוש אשראי פאם-פקס או תוכנית מהחנות שלנו-<br /> <br />אשראי פאם-פקס לא פעיל לא יופסד! תמיד ניתן להפעיל מחדש את אשראי פאם-פקס במועד מאוחר \nיותר. שום כסף לא מנוכה מן החשבון שלך ואיננו גובים תשלום עבור הפעלתו מחדש<br /></div>",
"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_2" => "<div style=\"text-align: right;\">נראה כי לא נעשה שימוש כלשהו באשראי פאם פקס שלך הרבה זמן. הוא הופך להיות ללא פעיל  {days_to_expiration}  אם \nלא משתמשים בו במשך 180 ימים ברציפות.  יש לך<br /></div>\n<div style=\"text-align: right;\">ימים לפני שהוא הופך להיות לא \nפעיל.\nכיצד ניתן לשמור על מאזן פעיל? זה פשוט. בצע אחת מפעולות הבאות והמאזן \nיהיה פעיל עוד 180 ימים<br /> שלח מסמך או דף שער פקס- <br />{shop_url}  רכוש אשראי פאם-פקס או תוכנית מהחנות שלנו-<br /> <br />אשראי פאם-פקס לא פעיל לא יופסד! תמיד ניתן להפעיל מחדש את אשראי פאם-פקס במועד מאוחר \nיותר. שום כסף לא מנוכה מן החשבון שלך ואיננו גובים תשלום עבור הפעלתו מחדש<br /></div>",
"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_3" => "נראה כי לא נעשה שימוש כלשהו באשראי פאם פקס שלך הרבה זמן. הוא הופך להיות ללא פעיל אם \nלא משתמשים בו במשך 180 ימים ברציפות.  יש לך 48 שעות לפני שהוא הופך להיות ללא \nפעיל.\nכיצד ניתן לשמור על מאזן פעיל? זה פשוט. בצע אחת מפעולות הבאות והמאזן \nיהיה פעיל עוד 180 ימים שלח מסמך או דף שער של פקס- {shop_url}  רכוש אשראי פאם-פקס או תוכנית מהחנות שלנו- אשראי פאם-פקס לא פעיל לא יופסד! תמיד ניתן להפעיל מחדש את אשראי פאם-פקס במועד מאוחר \nיותר. שום כסף לא מנוכה מן החשבון שלך ואיננו גובים תשלום עבור הפעלתו מחדש",
"MSG_CREDIT_EXPIRATION_WARNING_MAIL_BODY" => "<div style=\"text-align: right;\">\n<div style=\"text-align: right;\">נראה כי לא נעשה שימוש כלשהו באשראי פאם פקס שלך הרבה זמן. הוא הופך להיות ללא פעיל  {days_to_expiration}  אם \nלא משתמשים בו במשך 180 ימים ברציפות.  יש לך<br /></div>\n<div style=\"text-align: right;\">ימים לפני שהוא הופך להיות לא \nפעיל\n<br /><br />:פרטי חשבונך<br /><br /> {username} :שם פאם-פקס<br />{credit} : מאזן<br /><br />כיצד ניתן לשמור על איזון פעיל? זה פשוט. בצע אחת מפעולות הבאות והמאזן \nיהיה פעיל עוד 180 ימים<br /><br /> שלח מסמך או דף שער של פקס- <br />{shop_url}  רכוש אשראי פאם-פקס או תוכנית מהחנות שלנו-<br /> <br />אשראי פאם-פקס לא פעיל לא יופסד! תמיד ניתן להפעיל מחדש את אשראי פאם-פקס במועד מאוחר \nיותר. שום כסף לא מנוכה מן החשבון שלך ואיננו גובים תשלום עבור הפעלתו מחדש<br /><br />{email_footer}<br /><br />הגן על סיסמתך<br />\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">צוות\nסאנדיקס לעולם לא יבקש ממך את הסיסמה באמצעות הדואר האלקטרוני. את מתבקש להכניס את הסיסמה רק בעת כניסה לפאם-פקס או באתר האינטרנט שלנו אם אתה רוצה לקנות משהו\n או לבדוק את חשבונך. תמיד תיכנס לפורטל פאם-פקס באמצעות חיבור מאובטח, אנו מבקשים \nממך  זה צריך גם להראות {portal_url}  לוודא שהכתובת בדפדפן שלך מתחילה בדיוק כמו זו <br />   סמל מנעול כדי לציין את חיבור מאובטח</div>\n<br /></div>\n</div>",
