"MSG_CREDIT_NOTIFICATION_EMAIL" => "<div style=\"text-align: right;\">אנו שולחים אליך מכתב זה ע''מ ליידע אותך כי אשראי פאם-פקס שלך הולך ואוזל\n נשארו  <br />{user_credit} רק<br /><br />\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">עכשיו זה זמן טוב כדי להוסיף אשראי פאם-פקס לחשבונך כדי שתוכל להמשיך לשלוח פקסים<br /> <a href=\"{shoplink1}\"> הוסף אשראי פאם-פקס</div>\n<a href=\"{shoplink1}\"> <br /></a></div>",
