"MSG_PLAN_EXPIRATION_WARNING_3" => "תסתיים בעוד 48 שעות {number} תוכנית פאם-פקס הכוללת את מספר הפקס שלך !זוהי הודעה אחרונה שאנו שולחים לךכדי להרחיב את תוכנית פאם-פקס (ולשמר את מספר הפקס), בצע שלבים פשוטים הבאים {shop_url_plans} לך לחנות של פאם-פקס \n  {username} כנס עם שם המשתמש שלך\nהשלם תשלום. לאחר תשלום מוצלח תוכנית הפקס שלך תורחב  יהיה שמיש עוד 3 או 12 חודשים (בהתאם להזמנה) כולל קבלת פקסים ללא ({number}) הגבלה  ({number})  אם לא תתבצע אף פעולה בתוך 48 שעות, מספר הפקס האישי שלך יוסר מחשבונך בפאם-פקס לצמיתות הערה: זה לא ישפיע על אשראי פאם-פקס בבחשבונך או על היכולת לשלוח פקסים.  \n התכנית הינה מנוי נפרד, שאינה קשורה לאשראי פאם-פקס בחשבונך",
"MSG_PLAN_EXPIRATION_WARNING_EMAIL_1" => "<div style=\"text-align: right;\">\n<div style=\"text-align: right;\">ימים  {days_to_expiration} יפוג ב {number} מספר הפקס שלך \n {expiration_date} ב<br /> כדי להרחיב את תוכנית פאם-פקס שלך (ולשמר את מספר הפקס שלך), בצע שלבים פשוטים הבאים<br /><br />{shop_url_plans} לך לחנות פאם-פקס -<br />{username}   כנס עם שם משתמש פאם-פקס שלך  - <br /> השלם תשלום. לאחר תשלום מוצלח תוכנית הפקס שלך תורחב -<br /><br /> ({number}) המספר שלך      <br /> לאחר מכן יהיה שמיש עוד 3 או 12 חודשים (בהתאם ההזמנה) כולל קבלת פקס ללא הגבלה<br /><br />\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">הערה: זה לא ישפיע על אשראי פאם-פקס בחשבונך או על היכולת לשלוח פקסים. התכנית הינה מנוי נפרד ולא קשורה לאשראי פאם-פקס בחשבונך</div>\n</div>\n</div>",
"MSG_PLAN_EXPIRATION_WARNING_EMAIL_2" => "<div style=\"text-align: right;\">\n<div style=\"text-align: right;\">\n<div style=\"text-align: right;\">ימים  {days_to_expiration} יפוג ב {number} מספר הפקס שלך \n {expiration_date} ב<br /> כדי להרחיב את תוכנית פאם-פקס שלך (ולשמר את מספר הפקס שלך), בצע שלבים פשוטים הבאים<br /><br />{shop_url_plans} לך לחנות פאם-פקס -<br />{username}   כנס עם שם משתמש פאם-פקס שלך - <br /> השלם תשלום. לאחר תשלום מוצלח תוכנית הפקס שלך תורחב -<br /><br /> ({number}) המספר שלך      <br /> לאחר מכן יהיה שמיש עוד 3 או 12 חודשים (בהתאם ההזמנה) כולל קבלת פקס ללא הגבלה<br /><br />\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">הערה: זה לא ישפיע על אשראי פאם-פקס בחשבונך או על היכולת לשלוח פקסים. התכנית הינה מנוי נפרד ולא קשורה לאשראי פאם-פקס בחשבונך</div>\n</div>\n</div>\n</div>",
"MSG_PLAN_EXPIRATION_WARNING_EMAIL_3" => "<div style=\"text-align: right;\">\n<div style=\"text-align: right;\">תסתיים בעוד 48 שעות {number} תוכנית פאם-פקס הכוללת את מספר הפקס שלך <br />!זהו דוא''ל אחרון שאנו שולחים לך<br /><br />כדי להרחיב את תוכנית פאם-פקס (ולשמר את מספר הפקס), בצע שלבים פשוטים הבאים<br /><br /> {shop_url_plans} לך לחנות של פאם-פקס \n  <br />{username} כנס עם שם המשתמש שלך\n<br />השלם תשלום. לאחר שהתשלום מתבצע בהצלחה תוכנית הפקס שלך הורחבה<br /> <br /> יהיה שמיש עוד 3 או 12 חודשים (בהתאם להזמנה) כולל קבלת פקסים ללא ({number}) <br />הגבלה<br /><br />  ({number})  אם לא תתבצע אף פעולה בתוך 48 שעות, מספר הפקס האישי שלך <br />יוסר מחשבונך בפאם-פקס לצמיתות<br /><br /> הערה: זה לא ישפיע על אשראי פאם-פקס בחשבונך או על היכולת לשלוח פקסים.  \n התכנית הינה מנוי נפרד, שאינה קשורה לאשראי פאם-פקס בחשבונך</div>\n</div>",
