"MSG_PROPLAN_EXTENDED" => "<div style=\"text-align: right;\">\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">תודה על הרחבת תוכנית פאם-פקס פרו שלך למפסר פקס הבא<br /><br />{number}<br /><br /><br /></div>\n</div>",
"MSG_PROPLAN_PURCHASED" => " חודשים הבאים {months} ברכותינו, תוכנית פאם-פקס פרו שלך הופעלה ל\nבקרוב תקבל צ'אט ואו דואר אלקטרוני עם מספר הפקס האישי. מרגע זה מספר הפקס שלך יהיה מוכן לקבל פקסים :\nיתרונותך חודשים {months} מנוי ל \nקבלת פקסים חופשית וללא הגבלה  הנחה משמעותית על מחירי דפים אצלנו עשרים דפי פקס אזור נמענים 1 (או שווה ערך באזורים אחרים) כל חודש\n אחסון לא מוגבל של פקסים שנשלחו והתקבלו שימוש חופשי במנהל החברה של פאם-פקס ואפשרות לתת לעובדים גישה לתיבך ולהקצות אשראי\n\nאין  פרסומות\nבשום מקום\n{expiredate} התוכנית תסתיים ב אנו אוטומטית נודיע לך מראש את תאריך התפוגה כך שתוכל להרחיב את תוכנית פאם-פקס בזמן ולשמר את המספר \nהתפוגה של התכנית לא תשפיע על אשראי פאם-פקס בחשבונך או על היכולת \nלשלוח פקסים. התכנית הינה מנוי נפרד, שאינו קשור לאשראי פאם-פקס בחשבונך",
"MSG_PROPLAN_REFUNDED" => "של תוכנית פאם-פקס פרו. עכשיו תאריך התפוגה של {order_id} היה החזר כספי על הזמנתך {expiredate} :התוכנית שלך הוא זה לא ישפיע על אשראי פאם-פקס שלך. אשראי פאם-פקס שהיה לך עדיין זמין בחשבונך. ניתן להשתמש בו כדי לשלוח פקסים",
