"MSG_WAIT_DEFAULT" => "...אנא המתן",
"MSG_WARN_ACCOUNT_DELETION" => "<div style=\"text-align: right;\"><!--[if gte mso 9]><xml> <w:WordDocument> <w:View>Normal</w:View> <w:Zoom>0</w:Zoom> <w:Compatibility> <w:BreakWrappedTables /> <w:SnapToGridInCell /> <w:ApplyBreakingRules /> <w:WrapTextWithPunct /> <w:UseAsianBreakRules /> </w:Compatibility> <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel> </w:WordDocument> </xml><![endif]-->\n<p class=\"MsoNormal\" style=\"text-align: right; direction: ltr; unicode-bidi: embed;\" align=\"right\"><span lang=\"HE\">כדי לאמת את המחיקה של חשבון פאם-פקס\nשלך לחץ על קישור זה</span>\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n{mso-style-name:\"Table Normal\";\nmso-tstyle-rowband-size:0;\nmso-tstyle-colband-size:0;\nmso-style-noshow:yes;\nmso-style-parent:\"\";\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\nmso-para-margin:0cm;\nmso-para-margin-bottom:.0001pt;\nmso-pagination:widow-orphan;\nfont-size:10.0pt;\nfont-family:\"Times New Roman\";}\n</style>\n<![endif]-->{deletion_link}<br /><br /> אם אתה סבור כי קיבלת דואר אלקטרוני זה בטעות, או כי אדם לא מורשה ניכנס לחשבון שלך, אנא <br />ע''מ לשנות את סיסמתך באופן מיידי {portal_url}כנס לפורטל פאם-פקס<br /></div>",
"MSG_WARN_EMAIL_CHANGED" => "הדואר האלקטרוני שלך שונה בהצלחה\n\n {old_email} :דואר האלקטרוני ישן\n{new_email} :דואר האלקטרוני חדש\n\nהערה: אתה אמור לקבל הודעה זו בשתי הכתובות\n\nאם אתה סבור כי קיבלת דואר אלקטרוני זה בטעות, או כי אדם לא מורשה ניכנס לחשבון שלך, אנא\nע''מ לשנות את סיסמתך באופן מיידי {portal_url}כנס לפורטל פאם-פקס",
"MSG_WARN_PASSWORD_CHANGED" => "<div style=\"text-align: right;\">סיסמתך בפאם-פקס שונתה בהצלחה<br /><br /> <a href=\"{portal_url}\">PamFax</a> עכשיו אתה יכול להיכנס ל<br />  פאם-פקס וסיסמתך החדשה  \"{userlogin}\" עם שם המשתמש <br /><br />\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">אם אתה סבור כי קיבלת דואר אלקטרוני זה בטעות, או כי אדם לא מורשה ניגש לחשבונך, אנא    ע''מ לשנות את סיסמתך באופן מיידי {portal_url}כנס לפורטל פאם-פקס  <a href=\"{portal_url}\"> <br /></a></div>\n</div>",
"MSG_WARN_USERNAME_CHANGED" => "<div style=\"text-align: right;\">שם משתמש פאם-פקס שלך שונה בהצלחה<br /><br /> {old_username} :שם משתמש ישן<br />{new_username} :שם משתמש חדש<br /><br />\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">אם אתה סבור כי קיבלת דואר אלקטרוני זה בטעות, או כי אדם לא מורשה ניכנס לחשבון שלך, אנא <br />ע''מ לשנות את סיסמתך באופן מיידי {portal_url}כנס לפורטל פאם-פקס <a href=\"{portal_url}\"><br /></a></div>\n<a href=\"{portal_url}\"> <br /></a></div>",
"MSG_WELCOME_FAX" => "<div style=\"text-align: right;\">,שלום<br /><br />\nתודה על התקנת פאם-פקס  \nשלחנו לך פקס ראשון זה כדי להראות לך כי מספר הפקס שלך פועל. כעת אתה מוכן לשלוח ולקבל פקסים עם פאם-פקס<br />?הידעת כי פאם-פקס מציעה לך יתרונות הבאים<br />\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\nauto;margin-left:18.0pt;text-align:right;direction:ltr;unicode-bidi:embed\" align=\"right\"><span lang=\"HE\">התוכנה זמינה עבור מיקרוסופט חלונות, מק או אס, אנדרואיד ואייפוןאייפד</span>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\nauto;margin-left:18.0pt;text-align:right;direction:ltr;unicode-bidi:embed\" align=\"right\">  <span lang=\"HE\">ניתן לפקסס בקלות מתוך אוטלוק</span> 2007/2010 , מאופשר בעת התקנת פאם-פקס לחלונות\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\nauto;margin-left:18.0pt;text-align:right;direction:ltr;unicode-bidi:embed\" align=\"right\">  <span lang=\"HE\">גישה לדרופבוקס, גוגל דרייב ובוקס</span><span lang=\"HE\"> </span>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\nauto;margin-left:18.0pt;text-align:right;direction:ltr;unicode-bidi:embed\" align=\"right\"><span lang=\"HE\">שליחת פקסים ברחבי העולם במחירים אטרקטיביים</span><span lang=\"HE\"> </span>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\nauto;margin-left:18.0pt;text-align:right;direction:ltr;unicode-bidi:embed\" align=\"right\"><span lang=\"HE\">שלם כשאתה הולך עם </span><span lang=\"HE\"><span lang=\"HE\">חבילות אשראי</span> ששולמו מראש </span><span lang=\"HE\"> </span>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\nauto;margin-left:18.0pt;text-align:right;direction:ltr;unicode-bidi:embed\" align=\"right\"><span lang=\"HE\">אשראי פאם-פקס שלך אינו פג לעולם</span><span lang=\"HE\"> </span>\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\nauto;margin-left:18.0pt;text-align:right;direction:ltr;unicode-bidi:embed\" align=\"right\"><span lang=\"HE\">כל מידע מוצפן מקצה לקצה. המסמכים נמצאים תחת שמירה קפדנית<br /></span>\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n{mso-style-name:\"Table Normal\";\nmso-tstyle-rowband-size:0;\nmso-tstyle-colband-size:0;\nmso-style-noshow:yes;\nmso-style-parent:\"\";\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\nmso-para-margin:0cm;\nmso-para-margin-bottom:.0001pt;\nmso-pagination:widow-orphan;\nfont-size:10.0pt;\nfont-family:\"Times New Roman\";}\n</style>\n<![endif]--><br />\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">תרוויח דפי פקס נוספים \n ללא תשלום על ידי המלצת פאם-פקס לחבריך. לכל אדם שהמלצת עליו ונרשם - אנו באופן אוטומטי נוסיף דף פקס חינם לחשבון שלך. אל פונקציית ההמלצה ניתן לגשת<br /> דרך היישום של פאם-פקס לאחר שליחת פקס או דרך הפורטל של פאם-פקס <br />!כמה שיותר\nאתה ממליץ כך יש לך יותר דפים חינמיים\nאנחנו מקווים שאהבת את השירות שלנו. אם יש לך שאלות אל תהסס ליצור עמנו קשר \nבאמצעות  www.pamfax.biz תמיכה באפשרות  באתר פאם-פקס בכתובת\nsupport@pamfax.biz או שלח לנו דואר \nאלקטרוני <br /> ברכות חמות<br />צוות פאם-פקס@סאנדיקס\n.\n \n \n \n \n</div>\n</div>",
"SETUP_CUSTOM_AskSkypePromo" => "סקייפ בקביעות מציעה מבצעים מדהימים. האם אתה מעוניין {#AppName} תודה שהתקנת  \n?לראות את המבצעים המיוחדים שיש לסקייפ",
"SETUP_CUSTOM_BillboardText1" => "שלח פקסים בקלות עם פאם-פקס\nלא נדרש כרטיס אשראי כדי להירשם \nשלח 3 דפים ללא תשלום לאחר ההרשמה\n אין מינימום רכישה חודשית\n ללא פרסומות בפקס שלך",
"SETUP_CUSTOM_BillboardText2" => "קבל פקסים בקלות עם פאם-פקס\nמספר פקס חופשי\nמספר מקומי אישי\nזמין במדינות העולם\nכלולה קבלת פקסים ללא הגבלה",
"SETUP_CUSTOM_BillboardText3" => "קבל ללא תמורה נוספת\nגש לדרופבוקס, גוגל דרייב ובוקס \nשליחת פקסים חופשית בין פאם-פקס לפאם-פקס\nגישה מכל מקום  \nקל, הגון, אמין",
