"SHOP_BASICPLAN_FULL_DESCRIPTION" => "<div style=\"text-align: right;\">\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">עלות תכנית הפקס החודשית\n שלנו מתחילה €3.95 $ לחודש. קבל פקסים בחינם וללא הגבלה<br />   אחד ממדינות רבות <strong><a href=\"/fax-number\"> </strong>בחר \nמספר פקס מקומי בלבד מתוך<br /> <span style=\"font-weight: bold;\"><br />כדי לשלוח שלם מייד - נדרש אשראי של פאם-פקס<br /></span></div>\n<a href=\"../fax-number\"> </a></div>",
"SHOP_BASICPLAN_HIGHLIGHTS" => "<div style=\"text-align: right;\">\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\"><strong>מספר פקס בקוד חיוג מקומי \n<br /><br />קבלת פקסים חינם וללא הגבלה<br /><br />ללא פרסומות</strong></div>\n</div>",
"SHOP_BASICPLAN_SHORT_DESCRIPTION" => "<div style=\"text-align: right;\"> <span style=\"font-weight: bold;\"> הרשמה בסיסית של פאם-פקס<br />\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\"><span style=\"font-weight: bold;\">כוללת את פרטי (קוד חיוג מקומי) מספר פקס ממספר מדינות שונות<br /></span><br />\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">כוללת קבלת פקסים ללא הגבלה. נדרשת חבילת אשראי פאם-פקס נפרדת לצורך שליחת פקסים</div>\n</div>\n<br /></div>",
"SHOP_CATEGORY_CREDIT" => "אשראי פאם-פקס",
"SHOP_CATEGORY_CREDIT_DESCRIPTION" => "רכש אשראי פאם-פקס כך תוכל לשלוח פקסים לכל מקום בעולם במחירים אטרקטיביים",
