"SHOP_EMAIL_STATUS_FAILED" => "נכשלה {order_id} #  אופס, משהו הלך לא כשורה. ההזמנהבדוק את סיכום התשלום שנשלח לך על ידי החברה, פנה אליהם לפרטים נוספים\n({shop_url})  אם לדעתך קרתה שגיאה, אנא הזמן שנית בחנות שלנו בעת סיום ההזמנה בחר באפשרות תשלום שונה\nאנו מתנצלים אם זה גרם לאי נעימות",
"SHOP_EMAIL_STATUS_FAILED_SUBJECT" => "נכשלה {order_id} הזמנת רכישה מספר",
"SHOP_EMAIL_STATUS_PENDING" => ".תודה על רכישתך. התשלום שלך סומן - בהמתנה במקרה זה אם בחרת לשלם באמצעות צ'ק אלקטרוני או העברה בנקאית  אישור של קבלת כספים ייקח כשלושה עד ארבעה ימים ({website_url}KB65 ראה)    .\nלאחר השלמת התלשלום ההזמנה תטופל באופן אוטומטי ואתה תקבל את אשראי פאם-פקס שלך אוו מספר פקס",
