"SHOP_FINAL_FAILURE" => "קרתה בעת עיבוד ההזמנה \"{error_message}\" שגיאהכשלון: השגיאה\nמצטערים על אי נוחות. אנא רכש שנית",
"SHOP_FINAL_PENDING" => "המתנה: ההזמנה שלך בהמתנה. אנא המתן עד שהתשלום יושלם\nאז מערכת שלנו תשלח אליך הודעת דואר אלקטרוני הכולל הנחיות נוספות",
