"TXT_REGMAIL_BODY" => "<div style=\"text-align: right;\">\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">ברוכים\n הבאים אל העולם הקסום של פאם-פקס - דרך חדשה לשליחת פקסים. חשבון פאם-פקס שלך ללא תשלום\n נוצר בהצלחה\n<br /><br />{username}\nשם משתמש פאם-פקס שלך הוא <br /><br />כעת ניתן להוריד ולהתקין את היישום של פאם-פקס להפעלת מערכת פקס  עוד יותר קלה. דף ההורדה<br /> אנו מספקים גם פאם-פקס עבור התקנים .<a href=\"{website_url}downloads\"><br /> .ניידים כגון אייפון, אייפד ואנדרואיד<br /><br /><a href=\"{shop_url}?addtobasket=Pack10\"> כעת זהו זמן טוב להוסיף<br />אשראי פאם-פקס לחשבונך כך שתוכל לשלוח פקסים<br /><br /><a href=\"{portal_url}myfaxes/newfax/\">PamFax Portal</a> כדי לשלוח כנס ל<br /><br />למה לא להמליץ על פאם-פקס לחבריך ולהרוויח דפי פקס חינמיים. מידע נוסף ניתן לקבל ב<br /> פורטל פאם-פקס <a href=\"{portal_url}recommend/\"><br /><br />\n<div id=\"resltext\" style=\"border-bottom-width: 0px; margin-bottom: 0px; height: 123px;\">אנא שמור על הודעת דואר אלקטרוני זו לצורך שימוש בעתיד\n<br />תודה רבה לך על ההצטרפות לקהילת פאם-פקס, אנו מצפים לתת לכם את החוויה הטובה ביותר</div>\n<br /><br /></div>\n</div>",
